import React, { Component } from 'react'

export default class OrderDetails extends Component {
    constructor(props) {
        super()
        this.state = {
            details: "",
            fetch: false,
            receipt_id: props.receipt_id
        }
    }

    componentDidMount() {
        fetch('/all/listing', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json'
            },
            body: JSON.stringify({ receipt_id: this.state.receipt_id })
        })
            .then((res) => res.json())
            .then((res) =>

                this.setState({
                    details: res,
                    fetch: true
                })
            )
    }

    render() {

        return (
            <div>

            </div>
        )
    }
}
